        isAdmin: user.isAdmin
      },
      process.env.SECRET_KEY,
      { expiresIn: "5d" }
    );
    const { password, ...info } = user._doc;
    res.status(200).json({ accessToken, ...info });
  } catch (error) {
    res.status(500).json(error);
  }
});

module.exports = router;

